import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';

function ResultsPage() {
  const location = useLocation();
  const navigate = useNavigate();
  
  const userData = location.state ? location.state.user : null;
  const role = location.state ? location.state.role : "未知角色";

  const handleSelectionClick = () => {
    navigate('/selection');
  };

  return (
    <div className="container mt-5">
      <h1>宿舍信息</h1>
      <div>
        <strong>角色:</strong> {role}
        <br />
        <strong>用户信息:</strong> {userData ? userData.map(info => <span key={info}>{info} </span>) : "无用户信息"}
      </div>
      <button className="btn btn-primary mt-3" onClick={handleSelectionClick}>选择/修改</button>
    </div>
  );
}

export default ResultsPage;
